import React from "react";
import "./index.css";

function Footer() {
  const date = new Date();
  return (
    <footer class="footer">
      <div class="footer-content">
        <p> Copyright </p>
        <span class="footer-icons">
          <a href="mailto:npatel224@gmail.com" target="_blank" rel="noopener noreferrer">
            <img 
            className="footer-icon" src="assets/images/email-icon-white-png-original.png" alt="email-icon" />
          </a>
          <a href="https://github.com/Nils224" target="_blank" rel="noopener noreferrer">
              <img class="footer-icon" src="assets/images/GitHub-Mark-Light-32px.png" alt="GitHub-icon" />
          </a>
          <a href="https://www.linkedin.com/in/nilesh-patel-6b093783/#"  target="_blank" rel="noopener noreferrer">
              <img class="footer-icon" src="assets/images/linkedin-6-32.png" alt="LinkedIn-icon" />
          </a>
        </span>
      </div>
    </footer>
  );
}

export default Footer;
